        {
            if (obj is IFormLinkGetter formLink)
            {
                return formLink.Equals(this);
            }
            if (obj is not IDoorGetter rhs) return false;
            return ((DoorCommon)((IDoorGetter)this).CommonInstance()!).Equals(this, rhs, crystal: null);
        }

